&quot;We can't be together anymore.&quot;

During high school, Hachi met Kuma, a strong-built guy, and Hanabi, Kuma's childhood friend. They become an inseparable trio. However, Kuma confesses to Hachi and Hanabi slowly stops showing his face when they officially start dating.

Later, when Hachi asked Hanabi why, he replied, &quot;If I'm near Hachi, I'll stay as a hedgehog forever because of my guilty conscience.&quot; Discovering this truth, Hachi disappears from both their lives. Yet, these three met once again... but even though there are three, there is only a place for one lover.

&quot;In order to meet you, I&hellip;&quot;

Enomoto, currently a college student, often finds himself reminiscing the days spent with his childhood friend Shimura, who had always been beside him up until six years ago. Due to a sudden transfer, Enomoto didn't get to ask Shimura where he was moving and he hadn't heard anything from him since.

Until one day, he suddenly reunites with Shimura in his Philosophy class in college. Enomoto is over the moon, but Shimura seems to feel differently...

&quot;I like you, Yuichi&quot;

&quot;Huh?!&quot;

&quot;I wanted to tell you before I took time off school. Is that weird? I'm sorry.&quot;

Yuichi was suddenly confessed to by his childhood friend, Chihiro.

Chihiro will be taking time off school... What's going on?!

However, Yuichi begins to notice Chihiro's increasing number of injuries and unsettled emotions, as well as the strong attraction he feels towards Chihiro, whose true feelings only hurt himself.

&quot;May I never be born again&quot;
A boy who had lived as an ordinary junior high school student until half a year ago, Ayumu, is trying to throw himself off the school rooftop.
What have pushed him to this point? And what is the true ending that awaits?

Hwa Gok is just a normal university student, until he sees a girl being attacked by the popular Lee Bin, and jumps in her defence. The only problem is that Lee Bin is more than meets the eye&hellip;

Espa&ntilde;ol:
Un humano, un lic&aacute;ntropo o un vampiro, &iexcl;&iquest;qu&eacute; soy?! Completamente ignorante de la existencia de estos depredadores, Hwa Gok sigue con su vida cotidiana... Es decir, hasta que Lee Bin le da la vuelta a su vida mordi&eacute;ndole en el cuello, provocando un torbellino de eventos que ninguno de ellos pod&iacute;a prever.

